main() {
  // Challenge 1
  // Print first 30 terms of Fibonnaci sequence
  // Fibonnaci sequence is generated by adding last two terms, here are first six terms for you
  // 1, 1, 2, 3, 5, 8
  fib(30);
}

void fib(int n)
{
  int temp1 = 0;
  int temp2 = 1;

  if (n < 1)
    return;

  for (int i = 1; i <= n; i++)
  {
    print(temp2);
    int next = temp1 + temp2;
    temp1 = temp2;
    temp2 = next;
  }
}